<script>
    document.addEventListener("DOMContentLoaded", function () {
        // List of state IDs that should have pinpoints
        const statesWithPins = ['INPB', 'INRJ', 'INTN', 'INUP', 'INUT', 'INWB', 'INJK', 'INBR', 'INAS', 'INGJ', 'INMP', 'INMH', 'INDL', 'INTG', 'INAN', 'INCH', 'INCT', 'INHR', 'INHP', 'INKA', 'INKL', 'INOR', 'INUT', 'INWB', 'INJK', 'INGA']; // IDs of states with pinpoints

        // Select all path elements representing states
        const states = document.querySelectorAll('path');
        const pinsGroup = document.getElementById('pins');

        states.forEach(state => {
            // Check if the state is in the list of states with pinpoints
            if (statesWithPins.includes(state.id)) {
                // Get the bounding box of the state path
                const bbox = state.getBBox();
                // Calculate the center of the bounding box
                const centerX = bbox.x + bbox.width / 2;
                const centerY = bbox.y + bbox.height / 2;

                // Create a pin element (small circle)
                const pin = document.createElementNS("http://www.w3.org/2000/svg", "use");
                pin.setAttribute("href", "#pin-icon");
                pin.setAttribute("x", centerX - 10); // Adjust according to the icon's size
                pin.setAttribute("y", centerY - 10); // Adjust according to the icon's size
                pin.setAttribute("width", "20"); // Width of the icon
                pin.setAttribute("height", "20");

                // Add the pin to the SVG
                pinsGroup.appendChild(pin);
            }
        });
    });

